import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello</h1>
      </header>
    </div>
  );
}

function Body(){
  return(
    <div className="Body">
        <input
          type="text"
          placeholder="Type Food Here"
          value={this.state.userInput}
          onChange={e => {
            this.changeUserInput(e.target.value);
          }}
        />
        <button
          onClick={() => {
            this.addFood(this.state.userInput);
          }}
        >
          Add Food
        </button>
        <button
          onClick={() => {
            this.pickFood(this.state.list);
          }}
        >
          Pick Food
        </button>
        <ul>
          {this.state.list.map(val => (
            <ul>
              <li>{val}</li>
              <button
                onClick={() => {
                  this.remove(val);
                }}
              >
                X
              </button>
            </ul>
          ))}
        </ul>
      </div>
  );
}

export default App;
